import React from 'react'
import * as FaIcons from 'react-icons/fa';
import { Link } from 'react-router-dom';
function navbar() {
    return (
        <>
           <div className='navbar'>
                <link to = "#" className='menuBars'>
                  <FaIcons.FaBars/>

                </link>

            </div> 
        </>
    )
}

export default navbar
